import React from "react";
import AgregarInstitucion from "../form/BotonesNavegacion";

const BotonesNavegacion = () => {
  return (
    <section id="actions">
        <AgregarInstitucion />
    <div class="container">
        <div class="row justify-content-center">
            <div class="col-12 col-md-4 d-flex justify-content-center">
                <a href="/" class="btn btn-info">
                    <i class="fa-solid fa-arrow-left-long"></i> Regresar
                </a>
            </div>
            <div class="col-12 col-md-4 d-flex justify-content-center">
                <a href="#" class="btn btn-success"
                   data-bs-toggle="modal" data-bs-target="#AgregarInstitucionModal">
                    <i class="fa-solid fa-user-plus"></i> Agregar Registro
                </a>
            </div>
        </div>
    </div>
</section>
  );
};

export default BotonesNavegacion;
